{
  "openapi": "3.1.0",
  "info": {
    "title": "crewAI custom GPT API",
    "description": "API for supporting crewAI GPT",
    "version": "0.1"
  },
  "servers": [
    {
      "url": "https://crew-ai-custom-gpt-crewai.replit.app",
      "description": "Main API server"
    }
  ],
  "paths": {
    "/read_crewai_code/{code_class}": {
      "get": {
        "summary": "Read Code",
        "operationId": "read_code_read_crewai_code__code_class__get",
        "parameters": [
          {
            "name": "code_class",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string",
              "title": "Code Class",
              "enum": [
                "agent",
                "task",
                "crew",
                "process"
              ]
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Response",
            "content": {
              "application/json": {
                "schema": {}
              }
            }
          },
          "422": {
            "description": "Validation Error",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/HTTPValidationError"
                }
              }
            }
          }
        }
      }
    },
    "/agent_examples/{type}": {
      "get": {
        "summary": "Agent Examples",
        "operationId": "agent_examples_agent_examples__type__get",
        "parameters": [
          {
            "name": "type",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string",
              "title": "Type",
              "enum": [
                "travel_related_examples",
                "financial_related_examples",
                "landing_page_generation_related_examples",
                "marketing_related_examples",
                "game_generation_related_examples"
              ]
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Response",
            "content": {
              "application/json": {
                "schema": {}
              }
            }
          },
          "422": {
            "description": "Validation Error",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/HTTPValidationError"
                }
              }
            }
          }
        }
      }
    },
    "/task_examples/{type}": {
      "get": {
        "summary": "Task Examples",
        "operationId": "task_examples_task_examples__type__get",
        "parameters": [
          {
            "name": "type",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string",
              "title": "Type",
              "enum": [
                "travel_related_examples",
                "financial_related_examples",
                "marketing_related_examples",
                "game_generation_related_examples"
              ]
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Response",
            "content": {
              "application/json": {
                "schema": {}
              }
            }
          },
          "422": {
            "description": "Validation Error",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/HTTPValidationError"
                }
              }
            }
          }
        }
      }
    }
  },
  "components": {
    "schemas": {
      "HTTPValidationError": {
        "properties": {
          "detail": {
            "items": {
              "$ref": "#/components/schemas/ValidationError"
            },
            "type": "array",
            "title": "Detail"
          }
        },
        "type": "object",
        "title": "HTTPValidationError"
      },
      "ValidationError": {
        "properties": {
          "loc": {
            "items": {
              "anyOf": [
                {
                  "type": "string"
                },
                {
                  "type": "integer"
                }
              ]
            },
            "type": "array",
            "title": "Location"
          },
          "msg": {
            "type": "string",
            "title": "Message"
          },
          "type": {
            "type": "string",
            "title": "Error Type"
          }
        },
        "type": "object",
        "required": [
          "loc",
          "msg",
          "type"
        ],
        "title": "ValidationError"
      }
    }
  }
}

{
  "openapi": "3.1.0",
  "info": {
    "title": "GPT Companion",
    "version": "1.0"
  },
  "servers": [
    {
      "url": "https://www.drafty.pro",
      "description": "Development server"
    }
  ],
  "components": {
    "schemas": {},
    "parameters": {}
  },
  "paths": {
    "/api/gpt/getGuides": {
      "post": {
        "summary": "Endpoint to get guides to create diagram",
        "x-openai-isConsequential": false,
        "operationId": "post_GetGuides",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "type": {
                    "type": "string",
                    "enum": [
                      "graph",
                      "class",
                      "sequence",
                      "mindmap",
                      "timeline",
                      "entity-relationship",
                      "pie-chart",
                      "drafty-database"
                    ],
                    "description": "Type of the diagram",
                    "example": "graph"
                  }
                },
                "required": [
                  "type"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Guides for creating this type of diagrams",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "guide": {
                      "type": "string"
                    }
                  },
                  "required": [
                    "guide"
                  ]
                }
              }
            }
          }
        }
      }
    },
    "/api/gpt/renderDiagram": {
      "post": {
        "summary": "",
        "x-openai-isConsequential": false,
        "operationId": "post_RenderDiagram",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "type": {
                    "type": "string",
                    "enum": [
                      "graph",
                      "class",
                      "sequence",
                      "mindmap",
                      "timeline",
                      "entity-relationship",
                      "pie-chart",
                      "drafty-database"
                    ],
                    "description": "Type of the diagram",
                    "example": "graph"
                  },
                  "diagramString": {
                    "type": "string",
                    "description": "The string for the chart rendering"
                  },
                  "documentName": {
                    "type": "string",
                    "description": "The name of the document in which the diagram will be placed"
                  },
                  "diagramTags": {
                    "type": "string",
                    "description": "For your diagram, include a total of 10 tags, written with commas in between. The first tag should be the primary one, characterizing the overall purpose of the diagram, such as #SMS for a social media marketing diagram or #Database for a database structure. The subsequent tags should provide additional details about the content, tools, focus, and key elements of the diagram, enhancing its searchability and identification.",
                    "example": "#Database, #DataModeling, #ERDiagram, #SQL, #Normalization, #DataStructure, #SchemaDesign, #RelationalDB, #DataIntegrity, #QueryOptimization"
                  },
                  "isContainsPrivateInfo": {
                    "type": "boolean",
                    "description": "If you notice the user input includes personal details such as their full name, email address, phone number, home address, company name, or any other identifiable information, then set this flag to true."
                  }
                },
                "required": [
                  "type",
                  "diagramString",
                  "documentName",
                  "diagramTags",
                  "isContainsPrivateInfo"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Diagram successfully rendered",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "link": {
                      "type": "string",
                      "description": "Link to edit diagram, show after rendering the preview. and write If you wish to save the diagram in SVG format or modify it, please follow the link."
                    },
                    "previewLink": {
                      "type": "string",
                      "description": "link to the preview of the presentation, you should render it in line using markdown ![alt text](link)"
                    }
                  }
                }
              }
            }
          },
          "422": {
            "description": "Error while rendering the diagram",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "errorMessage": {
                      "type": "string"
                    }
                  },
                  "required": [
                    "errorMessage"
                  ]
                }
              }
            }
          }
        }
      }
    }
  },
  "webhooks": {}
}

